function parse(n){return JSON.parse(n.data)}function stringify(n){return JSON.stringify(n)}function post(n){postMessage(stringify(n)),n.canTerminate&&close()}this.onmessage=function(n){var t=parse(n);try{var s=new XMLHttpRequest,e=function(){t.status=200,post(t)},r=function(){t.status=-1,t.url=null,post(t)};s.onload=e,s.onerror=r,s.open("GET",t.url,!0),s.responseType="blob",s.send()}catch(o){r()}};